import React from "react";
import styled from "styled-components";

export const StartBtn = () => {
  return (
    <EffectDiv>
      <Btn>Start!</Btn>
    </EffectDiv>
  );
};

export const AccountBtn = () => {
  return (
    <EffectDiv>
      <Btn style={{ fontSize: "1.2rem"}}> 회원가입/로그인 </Btn>
    </EffectDiv>
  );
};

const EffectDiv = styled.div`
  width: 11rem;
  height: 3.2rem;
  box-shadow: 3.5px 4px 5px #F01D76;
  border-radius: 50px;
  margin-bottom: 1.7rem;
`;
const Btn = styled.div`
  width: 11rem;
  height: 3.2rem;
  line-height: 3.2rem;
  background-color: #fff;
  border-radius: 50px;
  font-size: 2rem;
`;
